import React from 'react';

// import recharts
import {
    LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, Bar
} from 'recharts';

// import material ui core 
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';

import styles from '../../assets/styles/views/dashboard/dashgraphStyle.js';

const useStyles = makeStyles(styles);

export default function DashGraph(props) {

    const classes = useStyles();

    const titleCase = (str) => {
        var splitStr = str.toLowerCase().split(' ');
        for (var i = 0; i < splitStr.length; i++) {
            splitStr[i] = splitStr[i].charAt(0).toUpperCase() + splitStr[i].substring(1);
        }
        return splitStr.join(' ');
    }

    const getData = () => {
        if (props.data === []) {
            return ([
                {
                    "date": "",
                    "weight": 0
                }
            ]);
        }
    }
    function CustomLabel({ x, y, stroke, value, width }) {
        if (value) {
            // No label if there is a value. Let the cell handle it.
            return null;
        }

        return (
            <text
                x={x}
                y={y}
                // Move slightly above axis
                dy={-10}
                // Center text
                dx={width / 2}
                fill={stroke}
                fontSize={15}
                textAnchor="middle"
            >
                N/A
            </text>
        )
    }

    return (
        <Paper className={classes.paper}>
            {/* <LineChart width={500} height={400} data={getData}
                margin={{ top: 30, right: 50, left: 20, bottom: 5 }}>
                <XAxis dataKey="date" />
                <YAxis dataKey="weight" domain={['auto', 'auto']} />
                <CartesianGrid strokeDasharray="3 3" />
                <Tooltip />
                <Legend height={36} wrapperStyle={{ top: 0, left: 25 }} />
                <Line name={titleCase("temp")} type="monotone" dataKey="weight" />
            </LineChart> */}
            <Bar dataKey="rating" label={<CustomLabel />}>
                {
                    data.map((entry, index) => (
                        <Cell
                            fill='#FF0000'
                            key={`cell-${index}`}
                        />
                    ))
                }
            </Bar>
        </Paper>
    );
}
